import React from 'react';
import Navbar from './Navbar';
import styles from './Header.module.css';

const Header = () => {
  return (
    <Navbar>
      <h1 className={styles['header-text']}>Movie App</h1>
      <input type="text" />
      <p style={{ color: '#fff' }}>Log out</p>
    </Navbar>
  );
};

export default Header;
